function Validation(values) {
    alert("")
    let error = {};
    if(values.email === ""){
        error.email="Email shouold not be empty"
    }
    else{
        error.email="";
    }
    if(values.password === ""){
        error.password="Passwoed should not be empty"
    }
    else{
        error.email="";
    }
    return error;
 
}


export default Validation;
